import React from 'react';

import styles from './toolbar.module.css';
import Logo from '../logo/logo';
import NavigationItems from './navigationItems/items';

const ToolBar = (props) => {
    return (
        <header className={styles.Toolbar}>
            <div>MENU</div>
            <div>
                <Logo/>
            </div>
            <nav>
                <NavigationItems/>
            </nav>
        </header>
    );
}

export default ToolBar;
